class Solution:
    def minSwaps(self, nums) -> int:
        if len(nums) < 1:
            return 0

        num_of_one = nums.count(1)

        # Extend the array by concatenating it with itself
        nums = nums + nums

        # Initial number of zeros in the first window
        num_of_zero = 0
        for i in range(num_of_one):
            if nums[i] == 0:
                num_of_zero += 1

        # Minimum swaps is the initial number of zeros in the first window
        min_swaps = num_of_zero

        # Sliding window
        for i in range(1, len(nums) // 2):
            if nums[i - 1] == 0:
                num_of_zero -= 1
            if nums[i + num_of_one - 1] == 0:
                num_of_zero += 1

            min_swaps = min(min_swaps, num_of_zero)

        return min_swaps

